					width: $dot-active-width;
					border-color: $dot-border-active;
					background: $dot-background-active;
				}
			}
		}
	}

	&.owl-light {
		.owl-nav {
			[class*='owl-'] {
				border-color: #b7b7b7;

				&:not(.disabled):hover {
					border-color: $nav-border-hover;
				}
			}
		}
		.owl-dots {
			.owl-dot {
				&:hover {
					span {
						border-color: $primary-color;
						background: $primary-color;
					}
				}

				&.active {
					span {
						border-color: $primary-color;
						background: $primary-color;
					}
				}
